import React from 'react';

import {logoutUser} from "../actions/userActions";

import { useDispatch } from "react-redux";

import { connect } from "react-redux";

import '../stylesheets/Header.css';

/**
 * Header for navigering.
 * @component
 * @author Magnus & Sven
 */

const Header = (props) => {

    const dispatch = useDispatch();

    /**
     * Håndterer trykk på logout.
     * Dispatcher logoutUser
     * @returns void
     * @memberOf Header
     */

    const handleClick = () => {
        dispatch(logoutUser());
    }

    return (
    <div className="navBar">
        <div className="navBarContent">
            <img id="laddel" src="https://www.laddel.no/wp-content/uploads/2021/06/ladddel-gronn-logo-kopi-1024x248.png"/>
            {(props.auth.isAuthenticated) ? <button className="logoutButton" onClick={handleClick}>LOGG UT</button> : <div/>}
        </div>
    </div>
    )
}

const mapStateToProps = (state) => {
    return {
        auth: state.auth
    }
}

export default connect(mapStateToProps)(Header);
